import React from 'react'
import useBreadcrumbs from "use-react-router-breadcrumbs";

const Breadcrumbs = () => {
  const breadcrumbs = useBreadcrumbs();

  return (
    <div className="breadcrumbs">
      {breadcrumbs.map(({ breadcrumb, match }, index) => (
        <div className="bc" key={match.url}>
          <Link to={match.url || ""}>{breadcrumb}</Link>
          {index < breadcrumbs.length - 1 && ">"}
        </div>
      ))}
    </div>
  );
};
export default function Logic() {
  return (
    <div>
      <Breadcrumbs />
        &bull;<a href="https://sites.millersville.edu/bikenaga/math-proof/truth-tables/truth-tables.html">Truth Tables, Tautologies, and Logical Equivalences</a>&nbsp;Millersville University

    </div>
  )
}
